-- These don't need to be InnoDB tables, MyISAM would do just as well/better

DROP TABLE IF EXISTS counties;
CREATE TABLE counties
(
id int unsigned NOT NULL auto_increment,
name varchar(255),
county_type varchar(255),
parent varchar(255),
place_id int unsigned NOT NULL,
population int unsigned,
primary key(id),
key County (name),
key Parent (parent),
key Place (place_id)
) TYPE=InnoDB;


DROP TABLE IF EXISTS places;
CREATE TABLE places
(
id int unsigned NOT NULL auto_increment,
name varchar(255),
county_id varchar(255),
easting int unsigned,
northing int unsigned,
population int unsigned,
area int unsigned,
primary key(id),
key Place (name)
) TYPE=InnoDB;





